@testset "7.4.2 Exponentials of inverse hyperbolic cotangent functions" begin
    @variables a, c, m, n, p, x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*involving*exponentials*of*inverse*hyperbolic*cotangents=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*x^m*ℯ^(n*acoth(a*x))=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*ℯ^(n*acoth(a*x))=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [ℯ^acoth(a*x)*x^3, x, 8, (2*sqrt(1 - 1/(a^2*x^2))*x)/(3*a^3) + (3*sqrt(1 - 1/(a^2*x^2))*x^2)/(8*a^2) + (sqrt(1 - 1/(a^2*x^2))*x^3)/(3*a) + (1/4)*sqrt(1 - 1/(a^2*x^2))*x^4 + (3*atanh(sqrt(1 - 1/(a^2*x^2))))/(8*a^4)]
    @test_int [ℯ^acoth(a*x)*x^2, x, 7, (2*sqrt(1 - 1/(a^2*x^2))*x)/(3*a^2) + (sqrt(1 - 1/(a^2*x^2))*x^2)/(2*a) + (1/3)*sqrt(1 - 1/(a^2*x^2))*x^3 + atanh(sqrt(1 - 1/(a^2*x^2)))/(2*a^3)]
    @test_int [ℯ^acoth(a*x)*x^1, x, 6, (sqrt(1 - 1/(a^2*x^2))*x)/a + (1/2)*sqrt(1 - 1/(a^2*x^2))*x^2 + atanh(sqrt(1 - 1/(a^2*x^2)))/(2*a^2)]
    @test_int [ℯ^acoth(a*x), x, 5, sqrt(1 - 1/(a^2*x^2))*x + atanh(sqrt(1 - 1/(a^2*x^2)))/a]
    @test_int [ℯ^acoth(a*x)/x^1, x, 6, -acsc(a*x) + atanh(sqrt(1 - 1/(a^2*x^2)))]
    @test_int [ℯ^acoth(a*x)/x^2, x, 3, a*sqrt(1 - 1/(a^2*x^2)) - a*acsc(a*x)]
    @test_int [ℯ^acoth(a*x)/x^3, x, 3, (1/2)*a*sqrt(1 - 1/(a^2*x^2))*(2*a + 1/x) - (1/2)*a^2*acsc(a*x)]
    @test_int [ℯ^acoth(a*x)/x^4, x, 7, a^3*sqrt(1 - 1/(a^2*x^2)) - (1/3)*a^3*(1 - 1/(a^2*x^2))^(3/2) + (a^2*sqrt(1 - 1/(a^2*x^2)))/(2*x) - (1/2)*a^3*acsc(a*x)]
    @test_int [ℯ^acoth(a*x)/x^5, x, 5, (1/24)*a^3*sqrt(1 - 1/(a^2*x^2))*(16*a + 9/x) + (a*sqrt(1 - 1/(a^2*x^2)))/(4*x^3) + (a^2*sqrt(1 - 1/(a^2*x^2)))/(3*x^2) - (3/8)*a^4*acsc(a*x)]


    @test_int [ℯ^(2*acoth(a*x))*x^3, x, 4, (2*x)/a^3 + x^2/a^2 + (2*x^3)/(3*a) + x^4/4 + (2*log(1 - a*x))/a^4]
    @test_int [ℯ^(2*acoth(a*x))*x^2, x, 4, (2*x)/a^2 + x^2/a + x^3/3 + (2*log(1 - a*x))/a^3]
    @test_int [ℯ^(2*acoth(a*x))*x^1, x, 4, (2*x)/a + x^2/2 + (2*log(1 - a*x))/a^2]
    @test_int [ℯ^(2*acoth(a*x)), x, 4, x + (2*log(1 - a*x))/a]
    @test_int [ℯ^(2*acoth(a*x))/x^1, x, 4, -log(x) + 2*log(1 - a*x)]
    @test_int [ℯ^(2*acoth(a*x))/x^2, x, 4, x^(-1) - 2*a*log(x) + 2*a*log(1 - a*x)]
    @test_int [ℯ^(2*acoth(a*x))/x^3, x, 4, 1/(2*x^2) + (2*a)/x - 2*a^2*log(x) + 2*a^2*log(1 - a*x)]
    @test_int [ℯ^(2*acoth(a*x))/x^4, x, 4, 1/(3*x^3) + a/x^2 + (2*a^2)/x - 2*a^3*log(x) + 2*a^3*log(1 - a*x)]


    @test_int [ℯ^(3*acoth(a*x))*x^2, x, 14, -((4*sqrt(1 - 1/(a^2*x^2)))/(a^2*(a - 1/x))) + (14*sqrt(1 - 1/(a^2*x^2))*x)/(3*a^2) + (3*sqrt(1 - 1/(a^2*x^2))*x^2)/(2*a) + (1/3)*sqrt(1 - 1/(a^2*x^2))*x^3 + (11*atanh(sqrt(1 - 1/(a^2*x^2))))/(2*a^3)]
    @test_int [ℯ^(3*acoth(a*x))*x^1, x, 12, -((4*sqrt(1 - 1/(a^2*x^2)))/(a*(a - 1/x))) + (3*sqrt(1 - 1/(a^2*x^2))*x)/a + (1/2)*sqrt(1 - 1/(a^2*x^2))*x^2 + (9*atanh(sqrt(1 - 1/(a^2*x^2))))/(2*a^2)]
    @test_int [ℯ^(3*acoth(a*x)), x, 8, -((4*sqrt(1 - 1/(a^2*x^2)))/(a - 1/x)) + sqrt(1 - 1/(a^2*x^2))*x + (3*atanh(sqrt(1 - 1/(a^2*x^2))))/a]
    @test_int [ℯ^(3*acoth(a*x))/x^1, x, 8, -((4*a*sqrt(1 - 1/(a^2*x^2)))/(a - 1/x)) + acsc(a*x) + atanh(sqrt(1 - 1/(a^2*x^2)))]
    @test_int [ℯ^(3*acoth(a*x))/x^2, x, 5, -3*a*sqrt(1 - 1/(a^2*x^2)) - (2*(a + 1/x)^2)/(a*sqrt(1 - 1/(a^2*x^2))) + 3*a*acsc(a*x)]
    @test_int [ℯ^(3*acoth(a*x))/x^3, x, 9, (-(9/2))*a^2*sqrt(1 - 1/(a^2*x^2)) - (a^5*(1 - 1/(a^2*x^2))^(5/2))/(a - 1/x)^3 - (3*a^3*(1 - 1/(a^2*x^2))^(3/2))/(2*(a - 1/x)) + (9/2)*a^2*acsc(a*x)]
    @test_int [ℯ^(3*acoth(a*x))/x^4, x, 10, -((a + 1/x)^3/sqrt(1 - 1/(a^2*x^2))) - (1/3)*a*sqrt(1 - 1/(a^2*x^2))*(3*a + 1/x)^2 - (1/6)*a^2*sqrt(1 - 1/(a^2*x^2))*(28*a + 3/x) + (11/2)*a^3*acsc(a*x)]


    @test_int [ℯ^(4*acoth(a*x))*x^3, x, 4, (12*x)/a^3 + (4*x^2)/a^2 + (4*x^3)/(3*a) + x^4/4 + 4/(a^4*(1 - a*x)) + (16*log(1 - a*x))/a^4]
    @test_int [ℯ^(4*acoth(a*x))*x^2, x, 4, (8*x)/a^2 + (2*x^2)/a + x^3/3 + 4/(a^3*(1 - a*x)) + (12*log(1 - a*x))/a^3]
    @test_int [ℯ^(4*acoth(a*x))*x^1, x, 4, (4*x)/a + x^2/2 + 4/(a^2*(1 - a*x)) + (8*log(1 - a*x))/a^2]
    @test_int [ℯ^(4*acoth(a*x)), x, 4, x + 4/(a*(1 - a*x)) + (4*log(1 - a*x))/a]
    @test_int [ℯ^(4*acoth(a*x))/x^1, x, 4, 4/(1 - a*x) + log(x)]
    @test_int [ℯ^(4*acoth(a*x))/x^2, x, 4, -x^(-1) + (4*a)/(1 - a*x) + 4*a*log(x) - 4*a*log(1 - a*x)]
    @test_int [ℯ^(4*acoth(a*x))/x^3, x, 4, -1/(2*x^2) - (4*a)/x + (4*a^2)/(1 - a*x) + 8*a^2*log(x) - 8*a^2*log(1 - a*x)]
    @test_int [ℯ^(4*acoth(a*x))/x^4, x, 4, -1/(3*x^3) - (2*a)/x^2 - (8*a^2)/x + (4*a^3)/(1 - a*x) + 12*a^3*log(x) - 12*a^3*log(1 - a*x)]


    #= ::Subsubsection::Closed:: =#
    #=n<0=#


    @test_int [x^3/ℯ^acoth(a*x), x, 8, -((2*sqrt(1 - 1/(a^2*x^2))*x)/(3*a^3)) + (3*sqrt(1 - 1/(a^2*x^2))*x^2)/(8*a^2) - (sqrt(1 - 1/(a^2*x^2))*x^3)/(3*a) + (1/4)*sqrt(1 - 1/(a^2*x^2))*x^4 + (3*atanh(sqrt(1 - 1/(a^2*x^2))))/(8*a^4)]
    @test_int [x^2/ℯ^acoth(a*x), x, 7, (2*sqrt(1 - 1/(a^2*x^2))*x)/(3*a^2) - (sqrt(1 - 1/(a^2*x^2))*x^2)/(2*a) + (1/3)*sqrt(1 - 1/(a^2*x^2))*x^3 - atanh(sqrt(1 - 1/(a^2*x^2)))/(2*a^3)]
    @test_int [x^1/ℯ^acoth(a*x), x, 6, -((sqrt(1 - 1/(a^2*x^2))*x)/a) + (1/2)*sqrt(1 - 1/(a^2*x^2))*x^2 + atanh(sqrt(1 - 1/(a^2*x^2)))/(2*a^2)]
    @test_int [ℯ^(-acoth(a*x)), x, 5, sqrt(1 - 1/(a^2*x^2))*x - atanh(sqrt(1 - 1/(a^2*x^2)))/a]
    @test_int [1/(ℯ^acoth(a*x)*x^1), x, 6, acsc(a*x) + atanh(sqrt(1 - 1/(a^2*x^2)))]
    @test_int [1/(ℯ^acoth(a*x)*x^2), x, 3, (-a)*sqrt(1 - 1/(a^2*x^2)) - a*acsc(a*x)]
    @test_int [1/(ℯ^acoth(a*x)*x^3), x, 3, (1/2)*a*sqrt(1 - 1/(a^2*x^2))*(2*a - 1/x) + (1/2)*a^2*acsc(a*x)]
    @test_int [1/(ℯ^acoth(a*x)*x^4), x, 7, (-a^3)*sqrt(1 - 1/(a^2*x^2)) + (1/3)*a^3*(1 - 1/(a^2*x^2))^(3/2) + (a^2*sqrt(1 - 1/(a^2*x^2)))/(2*x) - (1/2)*a^3*acsc(a*x)]
    @test_int [1/(ℯ^acoth(a*x)*x^5), x, 5, (1/24)*a^3*sqrt(1 - 1/(a^2*x^2))*(16*a - 9/x) - (a*sqrt(1 - 1/(a^2*x^2)))/(4*x^3) + (a^2*sqrt(1 - 1/(a^2*x^2)))/(3*x^2) + (3/8)*a^4*acsc(a*x)]


    @test_int [x^3/ℯ^(2*acoth(a*x)), x, 4, (-2*x)/a^3 + x^2/a^2 - (2*x^3)/(3*a) + x^4/4 + (2*log(1 + a*x))/a^4]
    @test_int [x^2/ℯ^(2*acoth(a*x)), x, 4, (2*x)/a^2 - x^2/a + x^3/3 - (2*log(1 + a*x))/a^3]
    @test_int [x^1/ℯ^(2*acoth(a*x)), x, 4, (-2*x)/a + x^2/2 + (2*log(1 + a*x))/a^2]
    @test_int [ℯ^(-2*acoth(a*x)), x, 4, x - (2*log(1 + a*x))/a]
    @test_int [1/(ℯ^(2*acoth(a*x))*x^1), x, 4, -log(x) + 2*log(1 + a*x)]
    @test_int [1/(ℯ^(2*acoth(a*x))*x^2), x, 4, x^(-1) + 2*a*log(x) - 2*a*log(1 + a*x)]
    @test_int [1/(ℯ^(2*acoth(a*x))*x^3), x, 4, 1/(2*x^2) - (2*a)/x - 2*a^2*log(x) + 2*a^2*log(1 + a*x)]
    @test_int [1/(ℯ^(2*acoth(a*x))*x^4), x, 4, 1/(3*x^3) - a/x^2 + (2*a^2)/x + 2*a^3*log(x) - 2*a^3*log(1 + a*x)]


    @test_int [x^3/ℯ^(3*acoth(a*x)), x, 19, -((4*sqrt(1 - 1/(a^2*x^2)))/(a^3*(a + 1/x))) - (6*sqrt(1 - 1/(a^2*x^2))*x)/a^3 + (19*sqrt(1 - 1/(a^2*x^2))*x^2)/(8*a^2) - (sqrt(1 - 1/(a^2*x^2))*x^3)/a + (1/4)*sqrt(1 - 1/(a^2*x^2))*x^4 + (51*atanh(sqrt(1 - 1/(a^2*x^2))))/(8*a^4)]
    @test_int [x^2/ℯ^(3*acoth(a*x)), x, 14, (4*sqrt(1 - 1/(a^2*x^2)))/(a^2*(a + 1/x)) + (14*sqrt(1 - 1/(a^2*x^2))*x)/(3*a^2) - (3*sqrt(1 - 1/(a^2*x^2))*x^2)/(2*a) + (1/3)*sqrt(1 - 1/(a^2*x^2))*x^3 - (11*atanh(sqrt(1 - 1/(a^2*x^2))))/(2*a^3)]
    @test_int [x^1/ℯ^(3*acoth(a*x)), x, 12, -((4*sqrt(1 - 1/(a^2*x^2)))/(a*(a + 1/x))) - (3*sqrt(1 - 1/(a^2*x^2))*x)/a + (1/2)*sqrt(1 - 1/(a^2*x^2))*x^2 + (9*atanh(sqrt(1 - 1/(a^2*x^2))))/(2*a^2)]
    @test_int [ℯ^(-3*acoth(a*x)), x, 8, (4*sqrt(1 - 1/(a^2*x^2)))/(a + 1/x) + sqrt(1 - 1/(a^2*x^2))*x - (3*atanh(sqrt(1 - 1/(a^2*x^2))))/a]
    @test_int [1/(ℯ^(3*acoth(a*x))*x^1), x, 8, -((4*a*sqrt(1 - 1/(a^2*x^2)))/(a + 1/x)) - acsc(a*x) + atanh(sqrt(1 - 1/(a^2*x^2)))]
    @test_int [1/(ℯ^(3*acoth(a*x))*x^2), x, 5, 3*a*sqrt(1 - 1/(a^2*x^2)) + (2*(a - 1/x)^2)/(a*sqrt(1 - 1/(a^2*x^2))) + 3*a*acsc(a*x)]
    @test_int [1/(ℯ^(3*acoth(a*x))*x^3), x, 9, (-(9/2))*a^2*sqrt(1 - 1/(a^2*x^2)) - (a^5*(1 - 1/(a^2*x^2))^(5/2))/(a + 1/x)^3 - (3*a^3*(1 - 1/(a^2*x^2))^(3/2))/(2*(a + 1/x)) - (9/2)*a^2*acsc(a*x)]
    @test_int [1/(ℯ^(3*acoth(a*x))*x^4), x, 10, (1/6)*a^2*sqrt(1 - 1/(a^2*x^2))*(28*a - 3/x) + (a - 1/x)^3/sqrt(1 - 1/(a^2*x^2)) + (1/3)*a*sqrt(1 - 1/(a^2*x^2))*(3*a - 1/x)^2 + (11/2)*a^3*acsc(a*x)]
    @test_int [1/(ℯ^(3*acoth(a*x))*x^5), x, 14, (-(27/4))*a^4*sqrt(1 - 1/(a^2*x^2)) - (9/8)*a^3*sqrt(1 - 1/(a^2*x^2))*(2*a - 3/x) - (a*(a - 1/x)^3)/sqrt(1 - 1/(a^2*x^2)) + (a*sqrt(1 - 1/(a^2*x^2)))/(4*x^3) - (a^2*sqrt(1 - 1/(a^2*x^2)))/x^2 - (51/8)*a^4*acsc(a*x)]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*ℯ^(n/2*acoth(a*x))=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [ℯ^(acoth(a*x)/2)*x^4, x, 11, (611*(1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(1/4)*x)/(1920*a^4) + (269*(1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(1/4)*x^2)/(960*a^3) + (11*(1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(1/4)*x^3)/(48*a^2) + (9*(1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(1/4)*x^4)/(40*a) + (1/5)*(1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(1/4)*x^5 + (31*atan((1 + 1/(a*x))^(1/4)/(1 - 1/(a*x))^(1/4)))/(128*a^5) + (31*atanh((1 + 1/(a*x))^(1/4)/(1 - 1/(a*x))^(1/4)))/(128*a^5)]
    @test_int [ℯ^(acoth(a*x)/2)*x^3, x, 10, (83*(1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(1/4)*x)/(192*a^3) + (29*(1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(1/4)*x^2)/(96*a^2) + (7*(1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(1/4)*x^3)/(24*a) + (1/4)*(1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(1/4)*x^4 + (11*atan((1 + 1/(a*x))^(1/4)/(1 - 1/(a*x))^(1/4)))/(64*a^4) + (11*atanh((1 + 1/(a*x))^(1/4)/(1 - 1/(a*x))^(1/4)))/(64*a^4)]
    @test_int [ℯ^(acoth(a*x)/2)*x^2, x, 9, (11*(1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(1/4)*x)/(24*a^2) + (5*(1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(1/4)*x^2)/(12*a) + (1/3)*(1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(1/4)*x^3 + (3*atan((1 + 1/(a*x))^(1/4)/(1 - 1/(a*x))^(1/4)))/(8*a^3) + (3*atanh((1 + 1/(a*x))^(1/4)/(1 - 1/(a*x))^(1/4)))/(8*a^3)]
    @test_int [ℯ^(acoth(a*x)/2)*x, x, 7, ((1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(1/4)*x)/(4*a) + (1/2)*(1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(5/4)*x^2 + atan((1 + 1/(a*x))^(1/4)/(1 - 1/(a*x))^(1/4))/(4*a^2) + atanh((1 + 1/(a*x))^(1/4)/(1 - 1/(a*x))^(1/4))/(4*a^2)]
    @test_int [ℯ^(acoth(a*x)/2), x, 6, (1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(1/4)*x + atan((1 + 1/(a*x))^(1/4)/(1 - 1/(a*x))^(1/4))/a + atanh((1 + 1/(a*x))^(1/4)/(1 - 1/(a*x))^(1/4))/a]
    @test_int [ℯ^(acoth(a*x)/2)/x, x, 17, (-sqrt(2))*atan(1 - (sqrt(2)*(1 - 1/(a*x))^(1/4))/(1 + 1/(a*x))^(1/4)) + sqrt(2)*atan(1 + (sqrt(2)*(1 - 1/(a*x))^(1/4))/(1 + 1/(a*x))^(1/4)) + 2*atan((1 + 1/(a*x))^(1/4)/(1 - 1/(a*x))^(1/4)) + 2*atanh((1 + 1/(a*x))^(1/4)/(1 - 1/(a*x))^(1/4)) + log(1 + sqrt(1 - 1/(a*x))/sqrt(1 + 1/(a*x)) - (sqrt(2)*(1 - 1/(a*x))^(1/4))/(1 + 1/(a*x))^(1/4))/sqrt(2) - log(1 + sqrt(1 - 1/(a*x))/sqrt(1 + 1/(a*x)) + (sqrt(2)*(1 - 1/(a*x))^(1/4))/(1 + 1/(a*x))^(1/4))/sqrt(2)]
    @test_int [ℯ^(acoth(a*x)/2)/x^2, x, 13, a*(1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(1/4) - (a*atan(1 - (sqrt(2)*(1 - 1/(a*x))^(1/4))/(1 + 1/(a*x))^(1/4)))/sqrt(2) + (a*atan(1 + (sqrt(2)*(1 - 1/(a*x))^(1/4))/(1 + 1/(a*x))^(1/4)))/sqrt(2) + (a*log(1 + sqrt(1 - 1/(a*x))/sqrt(1 + 1/(a*x)) - (sqrt(2)*(1 - 1/(a*x))^(1/4))/(1 + 1/(a*x))^(1/4)))/(2*sqrt(2)) - (a*log(1 + sqrt(1 - 1/(a*x))/sqrt(1 + 1/(a*x)) + (sqrt(2)*(1 - 1/(a*x))^(1/4))/(1 + 1/(a*x))^(1/4)))/(2*sqrt(2))]
    @test_int [ℯ^(acoth(a*x)/2)/x^3, x, 14, (a^2*(1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(1/4))/4 + (a^2*(1 - 1/(a*x))^(3/4)*(1 + 1/(a*x))^(5/4))/2 - (a^2*atan(1 - (sqrt(2)*(1 - 1/(a*x))^(1/4))/(1 + 1/(a*x))^(1/4)))/(4*sqrt(2)) + (a^2*atan(1 + (sqrt(2)*(1 - 1/(a*x))^(1/4))/(1 + 1/(a*x))^(1/4)))/(4*sqrt(2)) + (a^2*log(1 + sqrt(1 - 1/(a*x))/sqrt(1 + 1/(a*x)) - (sqrt(2)*(1 - 1/(a*x))^(1/4))/(1 + 1/(a*x))^(1/4)))/(8*sqrt(2)) - (a^2*log(1 + sqrt(1 - 1/(a*x))/sqrt(1 + 1/(a*x)) + (sqrt(2)*(1 - 1/(a*x))^(1/4))/(1 + 1/(a*x))^(1/4)))/(8*sqrt(2))]
